import React from "react";
import {Link,withRouter} from "react-router-dom";
import "./Navbar.css";
function Navbar(){
    return (
        <div className="Navbar">
            <li><Link to="/src/Navbar.jsx"><span id="l1">Money </span><span id="l2">Matters</span></Link></li>
        </div>
    );
}


export default Navbar;
